function changeTank(evt){
    var tankP = document.getElementById('tankPContents');
    tankP.innerHTML = '';
    var tankFid = this.options[this.selectedIndex].value;
    var tankText = this.options[this.selectedIndex].text;
    if (tankFid == '-1'){
        return;
    }
    var selTank = app.tanksLayer.getFeatureByFid(tankFid);
    var bounds = selTank.geometry.getBounds();
    map.zoomToExtent(bounds, false);

    var tankHeading = document.createElement('h4');
    console.log(parseInt(tankFid));
    tankHeading.innerHTML = tankText + ', Capacity: ' +
        tempDesign.tanks.features[parseInt(tankFid)].properties.capacity + ' gal';
    tankP.appendChild(tankHeading);


    var partsTable = document.createElement('table');
    var trEl = document.createElement('tr');
    var th1 = document.createElement('th');
    th1.innerHTML = 'Item';
    var th2 = document.createElement('th');
    th2.innerHTML = 'Quantity';
    trEl.appendChild(th1);
    trEl.appendChild(th2);
    partsTable.appendChild(trEl);


    var tankParts = {};
    switch (parseInt(tankFid)){
        case 0:
            tankParts['3/8 rebar'] = '833 ft';
            tankParts['1/4 rebar'] = '390 ft';
            tankParts['16x8x6 block'] = '252';
            tankParts['cement'] = '32 96# bags';
            tankParts['sand'] = '2.5 yd';
            tankParts['gravel'] = '3.5 yd';
            tankParts['fittings'] = 'various';
            break;
        case 1:
        case 2:
            tankParts['3/8 rebar'] = '713 ft';
            tankParts['1/4 rebar'] = '280 ft';
            tankParts['16x8x6 block'] = '192';
            tankParts['cement'] = '23 96# bags';
            tankParts['sand'] = '1.7 yd';
            tankParts['gravel'] = '2.5 yd';
            tankParts['fittings'] = 'various';
            break;
        default:
            break;
    }

    for (var key in tankParts){
        var newTableRow = document.createElement('tr');
        var newItem = document.createElement('td');
        newItem.innerHTML = key;
        var newQuant = document.createElement('td');
        newQuant.innerHTML = tankParts[key].toString();
        newTableRow.appendChild(newItem);
        newTableRow.appendChild(newQuant);
        partsTable.appendChild(newTableRow);
    }

   tankP.appendChild(partsTable);

    var tankImg = document.createElement('img');
    tankImg.src = imgURL + 'Tank' + tankFid + '.png';
    tankImg.height = '300';
    tankP.appendChild(tankImg);

}

function changeSupply(evt){
    var supplyFid = this.options[this.selectedIndex].value;
    if (supplyFid == '-1'){
        document.getElementById('elevProfImg').src = imgURL + 'ElevProfilenull.png';
        return;
    }
    var selSupply = app.pipeLayer.getFeatureByFid(supplyFid);
    var bounds = selSupply.geometry.getBounds();
    map.zoomToExtent(bounds, false);
    document.getElementById('elevProfImg').src =
        imgURL + 'ElevProfile' + supplyFid + '.png';
}